import React, { useState } from "react";
import './Login.css'
import SignUp from "../SignUp/SignUp";

export default function Login(props) {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  function validateForm() {
    return email.length > 0 && password.length > 0;
  }

  function handleSubmit(event) {
    event.preventDefault();
  }

  return (
    <div className ="container">
        <div className ="row justify-content-center">
        <div className="card m-4">
          <form  onSubmit={handleSubmit}>
            <div className="form-group mt-3" id="email">
            <label className ="ml-2 mr-5">Email</label>
            <input 
                autoFocus
                type="email"
                value={email}
                onChange={e => setEmail(e.target.value)}
            />
            </div>
            <div className="form-group mt-3" id="password">
            <label className ="ml-2 mr-3">Password</label>
            <input
                value={password}
                onChange={e => setPassword(e.target.value)}
                type="password"
            />
            </div>
            <button className='btn btn-custom m-3 btn-lg' disabled={!validateForm()} type="submit">
                Login
            </button>
          </form>
        </div>
        </div>
        <form onSubmit={<SignUp />}>
        <div className="row justify-content-center">
            <h5> New Customer</h5>
        </div>
        <div className = "row justify-content-center">
            <button className='btn btn-custom m-3' type="submit">Create an account</button>
        </div>
        </form>
    </div>
  );
}
